import React from 'react';
import {Carmini} from 'styled';

function CardPequeno(props) {
    return (
        <div className="mini-card">
            <img src={ props.imagem } />
            <div>
                <p><strong>{ props.nome }</strong></p>
                <p>{ props.descricao }</p>
            </div>
        </div>
    )
}

export default CardPequeno;
